import React from 'react';
import Particles from './particles'

function ParticlesComponent({ className }) {
  return (
    <div className={className}>
      <Particles
        options={{
          particles: {
            number: {
              value: 100,
            },
            size: {
              value: 3,
            },
            move: {
              speed: 2,
            },
          },
        }}
      />
    </div>
  );
}

export default ParticlesComponent;
